import './App.css';
import * as c from "./components";
import { useEffect, useState } from 'react';

function App() {
  const [data, setData] = useState('no data')
  const [val, setVal] = useState('')
  useEffect(() => {
    fetch(`https://test.spaceflightnewsapi.net/api/v2/${val}`)
      .then(response => response.json())
      .then(json => setData(json))
  }, [val])   

  return (
    <>
    <h1>My Header {val}</h1>
    <button onClick={(e)=> setVal('articles')}>articles</button>
    {/* <button onClick={(e)=> setVal('posts')}>posts</button> */}

    <pre>{JSON.stringify(data, null ,2)}</pre>
      {/* <c.Header/> */}
    </>
  );
}

export default App;
